// function that filters out words that are anagrams of previous words in the array
const f_gold = (words) => {
    return words.filter((w, i) => {
        // check if the current word is the first word in the array or if it is not an anagram of the previous word
        return i === 0 || w.split('').sort().join('') !== words[i - 1].split('').sort().join('');
    });
};
